// src/components/UserPage.js
import React from 'react';
import { useParams } from 'react-router-dom';
import './UserPage.css';

const UserPage = () => {
  const { username } = useParams();

  return (
    <div className="user-page-container">
      <h1>Welcome, {username}!</h1>
    </div>
  );
};

export default UserPage;
